webpackJsonp([1995],{"./node_modules/json-loader/index.js!./.cache/json/articles-certificates-diff-two-arrays.json":function(e,o){e.exports={data:{markdownRemark:{html:'<div class="lightbox-wrapper">[![](//discourse-user-assets.s3.amazonaws.com/optimized/2X/2/24043ff6eaf64c58ca15936ec29bd7c22809c9de_1_690x379.gif)\n<div class="meta"><span class="filename">HkEgef5.gif</span><span class="informations">698x384 72.4 KB</span><span class="expand"></span></div>](//discourse-user-assets.s3.amazonaws.com/original/2X/2/24043ff6eaf64c58ca15936ec29bd7c22809c9de.gif "HkEgef5.gif") </div>\n<p><img src="https://forum.freecodecamp.com/images/emoji/emoji_one/triangular_flag_on_post.png?v=3" alt=":triangular_flag_on_post:" title=":triangular_flag_on_post:"> Remember to use <a><strong><code>Read-Search-Ask</code></strong></a> if you get stuck. Try to pair program <img src="https://forum.freecodecamp.com/images/emoji/emoji_one/busts_in_silhouette.png?v=3" alt=":busts_in_silhouette:" title=":busts_in_silhouette:"> and write your own code <img src="https://forum.freecodecamp.com/images/emoji/emoji_one/pencil.png?v=3" alt=":pencil:" title=":pencil:"></p>\n<h3><img src="https://forum.freecodecamp.com/images/emoji/emoji_one/checkered_flag.png?v=3" alt=":checkered_flag:" title=":checkered_flag:"> Problem Explanation:</h3>\n<p>Check two arrays and return a new array that contains only the items that are not in either of the original arrays.</p>\n<h4>Relevant Links</h4>\n<ul>\n<li><a href="https://devdocs.io/javascript/statements/for">for Loop (Devdocs)</a></li>\n<li><a href="https://devdocs.io/javascript/global_objects/array/includes">Array.prototype.includes (Devdocs)</a></li>\n<li><a href="https://devdocs.io/javascript/global_objects/array/filter">Array.prototype.filter (Devdocs)</a></li>\n<li><a href="https://devdocs.io/javascript/global_objects/array/concat">Array.prototype.concat (Devdocs)</a></li>\n</ul>\n<h2><img src="https://forum.freecodecamp.com/images/emoji/emoji_one/speech_balloon.png?v=3" alt=":speech_balloon:" title=":speech_balloon:"> Hint: 1</h2>\n<p>Merge the list to make it easy to compare functions.</p>\n<blockquote>\n<p><em>try to solve the problem now</em></p>\n</blockquote>\n<h2><img src="https://forum.freecodecamp.com/images/emoji/emoji_one/speech_balloon.png?v=3" alt=":speech_balloon:" title=":speech_balloon:"> Hint: 2</h2>\n<p>Use filter to get the new array, you will need to create a callback function.</p>\n<blockquote>\n<p><em>try to solve the problem now</em></p>\n</blockquote>\n<h2><img src="https://forum.freecodecamp.com/images/emoji/emoji_one/speech_balloon.png?v=3" alt=":speech_balloon:" title=":speech_balloon:"> Hint: 3</h2>\n<p>The best way to go about the callback function is to check if the number from the new merged array is not in <strong>both</strong> original arrays and return it.</p>\n<blockquote>\n<p><em>try to solve the problem now</em></p>\n</blockquote>\n<h2>Spoiler Alert!</h2>\n<p><img src="//discourse-user-assets.s3.amazonaws.com/original/2X/2/2d6c412a50797771301e7ceabd554cef4edcd74d.gif" alt="687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif"></p>\n<p><strong>Solution ahead!</strong></p>\n<h2><img src="https://forum.freecodecamp.com/images/emoji/emoji_one/beginner.png?v=3" alt=":beginner:" title=":beginner:"> Basic Code Solution (Imperative Solution):</h2>\n<pre><code>function diffArray(arr1, arr2) {\n  var newArr = [];\n\n  function onlyInFirst(first, second) {\n  // Looping through an array to find elements that don\'t exist in another array\n    for (var i=0;i&#x3C;first.length;i++) {\n      if (second.indexOf(first[i]) === -1) {\n        // Pushing the elements unique to first to newArr\n        newArr.push(first[i]);\n      }\n    }\n  }\n\n  onlyInFirst(arr1, arr2);\n  onlyInFirst(arr2, arr1);\n\n  return newArr;\n}\n\ndiffArray([1, 2, 3, 5], [1, 2, 3, 4, 5]);\n</code></pre>\n<p><a href="https://repl.it/CLme/0"><kbd><img src="//discourse-user-assets.s3.amazonaws.com/original/2X/6/6d6bf8d908c0577924495e89482c7163190c3856.png"> <strong>Run Code</strong> <img src="https://forum.freecodecamp.com/images/emoji/emoji_one/rocket.png?v=3" alt=":rocket:" title=":rocket:"></kbd></a></p>\n<h3>Code Explanation:</h3>\n<p>Read the comments in the code.</p>\n<h4>Relevant Links</h4>\n<ul>\n<li><a href="https://devdocs.io/javascript/statements/for">for Loop (Devdocs)</a></li>\n</ul>\n<h2><img src="https://forum.freecodecamp.com/images/emoji/emoji_one/sunflower.png?v=3" alt=":sunflower:" title=":sunflower:"> Intermediate Code Solution (Declarative Solution):</h2>\n<pre><code>function diffArray(arr1, arr2) {\n  return arr1\n    .concat(arr2)\n    .filter(\n        item => !arr1.includes(item) || !arr2.includes(item)\n    )\n}\n\ndiffArray([1, 2, 3, 5], [1, 2, 3, 4, 5]);\n</code></pre>\n<p><a href="https://repl.it/CNYb/0"><kbd><img src="//discourse-user-assets.s3.amazonaws.com/original/2X/6/6d6bf8d908c0577924495e89482c7163190c3856.png"> <strong>Run Code</strong> <img src="https://forum.freecodecamp.com/images/emoji/emoji_one/rocket.png?v=3" alt=":rocket:" title=":rocket:"></kbd></a></p>\n<h3>Code Explanation:</h3>\n<p>Explain solution here and add any relevant links</p>\n<h4>Relevant Links</h4>\n<ul>\n<li><a href="https://devdocs.io/javascript/global_objects/array/concat">Array.prototype.concat (Devdocs)</a></li>\n<li><a href="https://devdocs.io/javascript/global_objects/array/filter">Array.prototype.filter (Devdocs)</a></li>\n<li><a href="https://devdocs.io/javascript/global_objects/array/includes">Array.prototype.includes (Devdocs)</a></li>\n</ul>\n<h2><img src="https://forum.freecodecamp.com/images/emoji/emoji_one/rotating_light.png?v=3" alt=":rotating_light:" title=":rotating_light:"> Advanced Code Solution (Declarative Solution):</h2>\n<pre><code>function diffArray(arr1, arr2) {\n    return arr1\n      .filter(el => !arr2.includes(el))\n      .concat(\n        arr2.filter(el => !arr1.includes(el))\n      )\n}\n\ndiffArray([1, 2, 3, 5], [1, 2, 3, 4, 5]);\n</code></pre>\n<p><a href="https://repl.it/CNYU/0"><kbd><img src="//discourse-user-assets.s3.amazonaws.com/original/2X/6/6d6bf8d908c0577924495e89482c7163190c3856.png"> <strong>Run Code</strong> <img src="https://forum.freecodecamp.com/images/emoji/emoji_one/rocket.png?v=3" alt=":rocket:" title=":rocket:"></kbd></a></p>\n<h3>Code Explanation:</h3>\n<p>Explain solution here and add any relevant links</p>\n<h4>Relevant Links</h4>\n<ul>\n<li><a href="https://devdocs.io/javascript/global_objects/array/includes">Array.prototype.includes (Devdocs)</a></li>\n<li><a href="https://devdocs.io/javascript/global_objects/array/filter">Array.prototype.filter (Devdocs)</a></li>\n<li><a href="https://devdocs.io/javascript/global_objects/array/concat">Array.prototype.concat (Devdocs)</a></li>\n</ul>\n<h2><img src="https://forum.freecodecamp.com/images/emoji/emoji_one/clipboard.png?v=3" alt=":clipboard:" title=":clipboard:"> NOTES FOR CONTRIBUTIONS:</h2>\n<ul>\n<li><img src="https://forum.freecodecamp.com/images/emoji/emoji_one/warning.png?v=3" alt=":warning:" title=":warning:"> <strong>DO NOT</strong> add solutions that are similar to any existing solutions. If you think it is <strong><em>similar but better</em></strong>, then try to merge (or replace) the existing similar solution.</li>\n<li>Add an explanation of your solution.</li>\n<li>Categorize the solution in one of the following categories -- <strong>Basic</strong>, <strong>Intermediate</strong> and <strong>Advanced</strong>. <img src="https://forum.freecodecamp.com/images/emoji/emoji_one/traffic_light.png?v=3" alt=":traffic_light:" title=":traffic_light:"></li>\n<li>Please add your username only if you have added any <strong>relevant main contents</strong>. (<img src="https://forum.freecodecamp.com/images/emoji/emoji_one/warning.png?v=3" alt=":warning:" title=":warning:"> <strong><em>DO NOT</em></strong> <em>remove any existing usernames</em>)</li>\n</ul>\n<blockquote>\n<p>See <img src="https://forum.freecodecamp.com/images/emoji/emoji_one/point_right.png?v=3" alt=":point_right:" title=":point_right:"> <a href="http://forum.freecodecamp.com/t/algorithm-article-template/14272"><strong><code>Wiki Challenge Solution Template</code></strong></a> for reference.</p>\n</blockquote>',frontmatter:{title:"Diff Two Arrays",parent:"/home/stuart/guides/src/pages/articles/certificates/diff-two-arrays/index.md absPath of file"}}},pathContext:{slug:"/articles/certificates/diff-two-arrays/"}}}});
